style.css:
@-moz-document domain("forum.virtualracing.org") {
html,
.above_body,
.body_wrapper {
    background: #EEE none;
}
#sidebar_container > ul {
	background-color: #E1E1E1;
}
.blockfoot.actionbuttons {
	background-color: #EEE;
}
li.forumbit_post.old img.forumicon,
.threadbit:not(.new) .threadstatus {
	opacity: .5;
}
a.logo-image img {
	mix-blend-mode: multiply;
}

}
